import { AppBar, Avatar, withStyles } from '@material-ui/core';
import classNames from 'classnames';
import get from 'lodash/get';
import React from 'react';
import { connect } from 'react-redux';

const styles = theme => ({
    avatar: {
        'top': '10px',
        'left': '50%',
        'width': '100%',
        "height": "56px",
        position: 'absolute',
        //padding: 5,
        //background: '#d73c2a',
        boxSizing: 'content-box',
        transform: 'translateX(-50%)',
        borderRadius: 0,
        '& > img': {
            borderRadius: 0,
        },
    },
});






function MainNavbarLogo({ classes, navbarLogoUrl }) {
    return (
        <AppBar
            style={{ background: '#FFF' }}
            position="static"
            color="primary"
            elevation={0}
            className="user relative flex flex-col items-center justify-center pt-24 pb-16 mb-32 z-0"
        >

            <Avatar
                className={classNames(classes.avatar, 'avatar')}
                alt={process.env.REACT_APP_LOGO_NAME}
                src={navbarLogoUrl}
            />

        </AppBar>
    );
}

function mapStateToProps({ owp }) {
    return {
        navbarLogoUrl: get(owp, 'config.navbarLogoUrl'),
    };
}

export default withStyles(styles, { withTheme: true })(connect(mapStateToProps)(MainNavbarLogo));
